import React from 'react';
import './CompletionScreen.css';

const CompletionScreen = ({ score }) => {
  return (
    <div id="completion-screen">
      <h1>Herzlichen Glückwunsch!</h1>
      <p id="score">Deine Punktzahl: {score}</p>
      <p id="message">Du hast alle Aufgaben erfolgreich gelöst und die Tür nach draußen geöffnet.</p>
    </div>
  );
};

export default CompletionScreen;
